@import url("https://fonts.googleapis.com/css2?family=Mukta:wght@400;700&display=swap");
* {
  padding: 0;
  margin: 0;
  box-sizing: border-box;
}

.wrapper {
  font-size: 10px;
  background-color: #F9F9FF;
  color: #2B2B2B;
